import {loadJokes} from '../Graphqlservices/requests';
const endpointBaseURL='http://localhost:5000/graphql';

async function doSomething() {
    let result = await loadJokes('money');
    return result ;
}
let word=[];
 doSomething().then(results=>{
    word.push(results) ;
     
});


const loadJoke=  (state='',action)=>
{
    switch (action.type) {
        case 'LOADJOKE':
                  return state= word[0];
                                      
            break;
    
        default:
           return  state;
